   const sunrise = new Date(astroData[0]);
   const sunset = new Date(astroData[1]);
   const moonrise = new Date(astroData[2]);
   const moonset =new Date(astroData[3]);

    return(

        <section>
             <article>
             <h1>Astrological Events</h1>
             <img src= {<Astro/>} ></img>
             <strong>Sunrise:</strong> <p>{sunrise.toTimeString()}</p>
             <strong>Sunset:</strong> <p>{sunset.toLocaleTimeString()}</p>
            <strong>Moonrise:</strong> <p>{moonrise.toLocaleTimeString()}</p>
            <strong>Moonset:</strong> <p>{moonset.toLocaleTimeString()}</p>



        </article>

        </section>
    )
}
export default Astro;
